    /** this method will return a list of video id from search API */
    public List<String> parseVideoId(String json){

        JSONObject obj = new JSONObject(json);
        JSONArray arr = obj.getJSONArray("items");
        List<String> videoIdList = new ArrayList<>();

        for (int i = 0; i < arr.length(); i++) {
            /** snippet: time, channelId, title, description, thumbnails
             *  id: kind, videoId(this is a video) or channelId (this is a channel)
             */
            JSONObject snippet = arr.getJSONObject(i).getJSONObject("snippet");
            JSONObject id = arr.getJSONObject(i).getJSONObject("id");

            //save the list of video id;
            if(!id.isNull("videoId")){
                videoIdList.add(id.getString("videoId"));

            }
        }
        return videoIdList;
    }

    /** this method will return a list of video id + video titles from search API */
    public Map<String,String> parseVideoIdANDtitle(String json){

        Map<String,String>video_info = new HashMap<>();
        JSONObject obj = new JSONObject(json);
        JSONArray arr = obj.getJSONArray("items");


        for (int i = 0; i < arr.length(); i++) {
            /** snippet: time, channelId, title, description, thumbnails
             *  id: kind, videoId(this is a video) or channelId (this is a channel)
             */
            JSONObject snippet = arr.getJSONObject(i).getJSONObject("snippet");
            String videoTitle = snippet.getString("title");
            JSONObject id = arr.getJSONObject(i).getJSONObject("id");

            String videoId = "";
            if(!id.isNull("videoId")){ videoId = id.getString("videoId");}

            video_info.put(videoId,videoTitle);
        }
        return video_info;
    }

    public String parsePageToken(String json){
        String pageToken = "";
        JSONObject obj = new JSONObject(json);
        pageToken = obj.getString("nextPageToken");
        return pageToken;


    }



